import React, { Component } from 'react';

class Survey extends Component {
    render() {
        return (
            <div>
                <p>Welcome. This tool allows you to assess for yourself whether you are at risk of being infected with the Covid-19 or Novel Corona virus, as well as the level of risk and what to do.</p>
            </div>
        );
    }
}

export default Survey;
